import React, { Fragment} from "react";

import {
    CssClasses,
    addColorTypeToCssClass,
} 
from "../../utilities";

import * as Titles from "../../utilities/bootstrapTitles";

export const H1 = props => {
    const classes = new CssClasses();

    addColorTypeToCssClass({
        type: "text",
        classes: classes,
        props: props
    });
    
    console.log(classes.toString());

    const newProps = {...props};
    newProps["className"] = "text-light";

    console.log(classes.toString());

    return (
        <Titles.H1 className="text-light">
            a
        </Titles.H1>
    );
}
